history.origin:

    France
    Paris
, 15th century, middle. The calendar agrees in large part with the books of hours typical of 15th century Paris as presented by 
    Perdrizet (1933)
, with one feast (occasionally two) observed for each day of the year (many of them Eastern; important feasts in gold) and with several of the same (mis)spellings, e.g. albaire for Balbine on March 31 (); profer(t) for Gobert (Godobertus of Anger) on April 10 (); gobert  on April 21, possibly for Soter (; see 
    Perdrizet (1933)

), vandrille (Wandregisel of Fontenelle) on May 20 mistaken for Austregisilus of Bourges (; see 
    Perdrizet (1933)

); the unidentified pant(h)alin on June 2 (); proces on June 7, possibly for Procopius (; see 
    Perdrizet (1933)

); the unidentified osonans on August 5 (; see discussion in 
    Perdrizet (1933)

); presme for Privatus on 28 September (); christine for Charitina (), and emille for Amon on December 20 (see 
    Perdrizet (1933)

).
The style of the decorations and miniatures also place the manuscript in fifteenth-century Paris; Lindqvist Sandgren dates them to  at the latest (Lindqvist Sandgren). She also believes that some of the miniatures may have been painted at a later date, among them, the portrait of Katherine de Brunfay found on , which Lindqvist Sandgren identifies as a later addition, Katherine's dress, for example, being of the 16th century fashion.

history.provenance:
For several decades at least, the manuscript was in the possession of the de Brunfay family, which seems to have had its origins around the area of Vieux-Campagne, just southeast of Paris (see 
                                Annales de la Société historique & archéologique du Gatinais: Tome 26

                            ). On  is found a genealogy of the family written by a certain André de Brunfay. The earliest date he records is  (the birth of his (presumably) eldest son), and he signs his notes on July 14,  (: escript de ma mayn le dymenche xiiii de Juyllet Cc lx). At least three later hands have added entries for 1562  (the battle of Dreux; ), (the siege of Malta; ),  (),  (), and  (). Katherine de Brunfay is not mentioned in the genealogy.

